      <div className='text-center'>
        <img src={accueil} alt="accueil" className="accueil" />

        <h1 className='display-5 mb-5 mt-5'>CHOCO PAP</h1>
        <p>lslsl</p>

      </div>
    );
  }

  export default Acceuil;
